import React from "react";
import useCookie from "../hooks/useCookie";

const Home = () => {
  const {} = useCookie();
  const handleSignout = () => {};
  return (
    <div>
      <h1>Home</h1>
      <button onClick={handleSignout}>Signout</button>
    </div>
  );
};

export default Home;
